import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

function EventsPage() {
	return (
		<ComponentWrapper>
			<header>
				<a
					href="/events/newstart"
					class=""
					aria-label=""
					target="_blank"
					rel="noopener noreferrer"
					data-attribute-id="event__banner__click"
					data-landing-uri="/events/newstart"
					data-position="top"
				>
					<section
						class="BgImg_bgType__f_agX Banner_Banner_image__EBGa5"
						style='padding-bottom: 15%; background-image: url("https://image.wanted.co.kr/optimize?src=https://wanted-marketing-image.s3.ap-northeast-2.amazonaws.com/career-biz-banner/220719_event_web.jpg&amp;w=2000&amp;q=100");'
					></section>
				</a>
			</header>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div``;

export default EventsPage;
